import React from 'react'
import './Menu.css';
import { Link } from 'react-router-dom';
import MenuLogo from './logo.png'

function Menu() {
    const imageClick = () => {
        console.log('Click');
    }
    return (
        <div>
            <div className="Menu">
                <div className="MenuIcon">
                <Link to="#" className='menu-bars'><img src= {MenuLogo} alt= 'icon' width = "50px" height = "50px" onClick={() => imageClick()}/>
                </Link>
                </div>
            </div>
        </div>
    )
}

export default Menu
